const DefaultRed = "#d30000";

class UniformCatalog {

    private static _instance: UniformCatalog;

    private dominionWarSwatches = [
        new Swatch(BodyType.Body1, "Average Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody1, BodyType.Body1, token)),
        new Swatch(BodyType.Body2, "Heftier Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody2, BodyType.Body2, token)),
        new Swatch(BodyType.Body3, "Slighter Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody3, BodyType.Body3, token)),
        new Swatch(BodyType.Body4, "Muscular Body", (token) => UniformCatalog.decorateSwatch(DominionWarBody4, BodyType.Body4, token)),
    ];

    public static get instance() {
        if (UniformCatalog._instance == null) {
            UniformCatalog._instance = new UniformCatalog();
        }
        return UniformCatalog._instance;
    }

    getBody(token: Token) {
        let result = DominionWarBody1;
        if (token.bodyType === BodyType.Body2) {
            result = DominionWarBody2;
        } else if (token.bodyType === BodyType.Body3) {
            result = DominionWarBody3;
        } else if (token.bodyType === BodyType.Body4) {
            result = DominionWarBody4;
        }

        return result.replace(DefaultRed, token.divisionColor).replace(SpeciesOptions.DEFAULT_SKIN_COLOR, token.skinColor);
    }

    getSwatches(uniformEra: UniformEra) {
        return this.dominionWarSwatches;
    }

    private static decorateSwatch(svg: string, type: BodyType, token: Token) {
        let result = `<svg viewBox="0 0 300 300" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <defs>
                    <clipPath id="clipPath` + type + `">
                        <circle cx="150" cy="150" r="150" fill="#ffffff" />
                    </clipPath>
                </defs>
                <g clip-path="url(#clipPath` + type + `">
                    <g transform="translate(-70, -130)">`
                    + svg.replace(DefaultRed, token.divisionColor).replace(SpeciesOptions.DEFAULT_SKIN_COLOR, token.skinColor)
                + `</g>
                </g>
            </svg>`;
        return result;
    }
}

export default UniformCatalog;